B.afp=new A.du("Service Providers","  We may employ third-party companies and individuals due to the following reasons:\n\n  To facilitate our Service;\n  To provide the Service on our behalf;\n  To perform Service-related services; or\n  To assist us in analyzing how our Service is used.\n  We want to inform users of this Service that these third parties have access to your Personal Information. The reason is to perform the tasks assigned to them on our behalf. However, they are obligated not to disclose or use the information for any other purpose.\n  ",t.W)
B.afj=new A.du("Security","  We value your trust in providing us your Personal Information, thus we are striving to use commercially acceptable means of protecting it. But remember that no method of transmission over the internet, or method of electronic storage is 100% secure and reliable, and we cannot guarantee its absolute security.\n  ",t.W)
B.afh=new A.du("Links to Other Sites","  This Service may contain links to other sites. If you click on a third-party link, you will be directed to that site. Note that these external sites are not operated by us. Therefore, we strongly advise you to review the Privacy Policy of these websites. We have no control over and assume no responsibility for the content, privacy policies, or practices of any third-party sites or services.\n  ",t.W)
B.afr=new A.du("Children\u2019s Privacy","  These Services do not address anyone under the age of 13. We do not knowingly collect personally identifiable information from children under 13. In the case we discover that a child under 13 has provided us with personal information, we immediately delete this from our servers. If you are a parent or guardian and you are aware that your child has provided us with personal information, please contact us so that we will be able to do necessary actions.\n  ",t.W)
B.afo=new A.du("Changes to This Privacy Policy","  We may update our Privacy Policy from time to time. Thus, you are advised to review this page periodically for any changes. We will notify you of any changes by posting the new Privacy Policy on this page. These changes are effective immediately after they are posted on this page.\n  ",t.W)
